class Solution:
    def maxChunksToSorted(self, arr: List[int]) -> int:
        if len(arr) == 1:
            return 1
        stack = []
        stack.append(arr[0])
        for i in range(1, len(arr)):
            if arr[i] < stack[-1]:
                cur = stack.pop()
                while stack and arr[i] < stack[-1]:
                    stack.pop()
                stack.append(cur)
            else:
                stack.append(arr[i])
        return len(stack)
```
Each element in the stack represents a block in which the element is the biggest number. Iterate the arr and if find a value smaller than the top of the stack, this value needs to be merged into the blocks in the stack. To determine which block this value should be merged in, we need to compare it with the element in the blocks. At least, it should be merged with the block stored on the top of the stack, but it is also necessary to merage some blocks in the stack together as if the value is very small, for instance, stack=[3,4] and value=1, block 3, 4 and value 1 should be merged into one block. So, we first pop the last block or element in the stack (if the value is smaller than the top of stack, at least it should be merged into the top block), then we compare the value with left blocks and if find value < left_block, we need to pop left_block. We discard or merge the left_block by popping it. Finally we append the previous popped top block in the stack. 

Time O(N), space O(N)

