class Solution:
    def findMiddle(self, head):
        if not head or not head.next:
            return head

        prev_ptr = None
        slow_ptr = head
        fast_ptr = head

        while fast_ptr and fast_ptr.next:
            prev_ptr = slow_ptr
            slow_ptr = slow_ptr.next
            fast_ptr = fast_ptr.next.next

        if prev_ptr:
            prev_ptr.next = None

