    def sortedListToBST(self, head: Optional[ListNode]) -> Optional[TreeNode]:
        if not head:
            return None

        mid = self.findMiddle(head)
        root = TreeNode(mid.val)

        if head == mid:  
            return root

        root.left = self.sortedListToBST(head)
        root.right = self.sortedListToBST(mid.next)

