LRUCache.prototype.add = function (node) {
    const nodeBeforeTail = this.tail.prev;
    nodeBeforeTail.next = node;
    node.prev = nodeBeforeTail;
    node.next = this.tail;
    this.tail.prev = node;
}

 /** 
