    private  TreeNode toTree(ListNode start, ListNode end){
        if(start == end){
            return null;
        }
        ListNode slow = start;
        ListNode fast = start;
        while(fast != end && fast.next != end){
            fast = fast.next.next;
            slow = slow.next;
        }
        TreeNode root = new TreeNode(slow.val);
        root.left = toTree( start, slow);
        root.right = toTree( slow.next, end);
        return root;
